import React, {Component} from "react";
import {Jumbotron, Button, Container} from "react-bootstrap";

class Start extends Component {
    render() {
        return (
          <Container>
          <div>
              <Jumbotron>
                <h1>Ready to Start</h1>
              </Jumbotron>
            </div>
          </Container>
        );
    }
}

export default Start;
